import React from 'react';
import { useState, useEffect } from 'react';
import { Component } from 'react';
import './Webcams.css'

class App extends Component {
    state = {
      todos: [],
      activities_list: [],
    }
    componentDidMount() {
      fetch("https://developer.nps.gov/api/v1/activities/parks?id=activities&api_key=8NnStekoxJFhJSQlXFrZ4RmXW7ebm6OvQA4upeaF")
      .then(res => res.json())
      .then((data) => {
        var activities_temp = []
        this.setState({ todos: data})
        console.log(this.state.todos)
        var length = this.state.todos.length
        for(let i = 0; i < length; i++)
        {
          activities_temp[i] = ({ todos: data["data"][i]["name"]})
        }

        console.log(activities_temp)

        this.setState({activities_list: activities_temp})
        console.log(this.state.activities_list.length)

      })
      .catch(console.log)
    }


  render(){ 
    return (

    <div>
        <p>
        {JSON.stringify(this.state.todos)}

        TEST1
        </p>
        <h>
        {(this.state.activities_list)}
        </h>
    </div>   

  );
}
}
export default App
